def find_indexes_by_name(listing, substring)
  substring_downcased = substring.downcase
  listing.each_with_index.select { |line, index| line["Nom"].downcase.include?(substring_downcased) }.map(&:last)
end

table = box({ width: 1200, height: 333, overflow: :auto, color: :red , top: 200, left: 0})
search = table.box({ left: 0, top: 0, width: 199, height: 25, color: :black, position: :sticky, depth: 3 })
find = search.text({ data: :search, id: :search, edit: true, left: 3, top: -18 })
search.touch(:up) do
  find.data(" ")
end

search.keyboard(:up) do
  # puts "*#{find.data.chomp(" ")}*"
  data_to_find=find.data.chomp(" ")

  indexes = find_indexes_by_name(listing, data_to_find)
  index = indexes.join(', ')
  puts "Indexes pour les noms contenant #{data_to_find}: #{index}"

end

# we get the header
header_content = []
listing[0].each do |item, _v|
  header_content << item
end
cell_width = table.width / header_content.length
color({ blue: 0.2, id: :cell_col })
color({ red: 0.2, id: :line_col })
header = table.box({ width: 690, height: 33, left: 5, top: 34, depth: 1, color: :green })
header_content.each_with_index do |cell_header, index|
  header_cell= header.box({ width: cell_width-5, height: 30, top: 0, left: cell_width * index + 1, apply: :cell_col})
  header_cell.text(({data: header_content[index].to_s, component: {size: 12}}))

end

# we create the table below

listing.each_with_index do |line, index|
  line = table.box({ width: 690, height: 33, left: 5, top: index * 34 + 66, depth: 1, apply: :line_col })
  header_content.each_with_index do |col_cell, cell_index|
    cell = line.box({ width: cell_width-5, height: 30, top: 1, left: cell_width * cell_index + 1, apply: :cell_col })
    val= header_content[cell_index]
    cell_data= listing[index][val]
    cell.text({ data: cell_data, component: { size: 12 } })
  end
end


